import './App.css';
import IndexPage from "./pages/IndexPage.js";
import Layout from "./Layout.js";
import {Route, Routes} from "react-router-dom";

function App() {
  return (
    <div>
    <Routes>
      <Route path="/" element={<Layout />}>

      <Route index element={
        <IndexPage />
      }/>

      <Route path={'/login'} element={<LoginPage />}/>

      </Route>
    </Routes>
    </div>
  );
}

export default App;
